  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of the present research project
  is to develop and implement a protocol for short- and long-term monitoring of forest
  plant communities on National Wildlife Refuges in the mid-Atlantic region. Three
  National Wildlife Refuges were selected to test the protocol, and to acquire preliminary
  data on plant communities. These refuges are Erie, Great Swamp and Montezuma. This
  report focuses on the work done at Erie National Wildlife Refuge.\",\n\t\"license_title\":
